import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import { Button, CardActionArea, CardActions, CardHeader } from '@mui/material';

export default function MultiActionAreaCard() {
  return (
    <Card sx={{ maxWidth: 500 }}>
      <CardActionArea>
        <CardHeader 
          sx={{backgroundColor:"#d3d3d3"}}
          height="200"
          title='Create an Organization'
        />
        <CardContent>
          <Typography gutterBottom component="p" sx={{fontSize:'10px'}}>
            Organizations allow you to invite team members and assign them to workspaces
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Lizards are a widespread group of reptiles, with over 6,000
            species, ranging across all continents except Antarctica
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
      </CardActions>
    </Card>
  );
}
